static.html.body:
处理静态文件
您将注意到在项目结构中，我们有两个静态资源目录：src/assets和static/。它们之间有什么区别？
Webpacked
To answer this question, we first need to understand how Webpack deals with static assets. In *.vue components, all your templates and CSS are parsed by vue-html-loader and css-loader to look for asset URLs. For example, in  and background: url(./logo.png), "./logo.png" is a relative asset path and will be resolved by Webpack as a module dependency.
为了回答这个问题，我们首先需要了解Webpack如何处理静态资产。在*.vue组件中，您的所有模板和CSS都由解析vue-html-loader和css-loader查找资源网址。例如，在和中background: url(./logo.png)，"./logo.png"是相对资产路径，将由Webpack解析为模块依赖项。
因为logo.png不是JavaScript，当被当作模块依赖，我们需要使用url-loader和file-loader处理它。这个样板文件已经为你配置了这些加载器，所以你基本上可以免费获得文件名指纹和条件base64内联等功能，同时能够使用相对/模块路径，而不必担心部署。
由于这些资源可能在构建期间内联/复制/重命名，因此它们基本上是源代码的一部分。这就是为什么建议将Webpack处理的静态资源放在里面/src，沿着其他源文件。事实上，你甚至不必把它们全部/src/assets：你可以根据模块/组件使用它们来组织它们。例如，您可以将每个组件放在其自己的目录中，其静态资产位于其旁边。
文件解析规则

相对URL，例如./assets/logo.png将被解释为模块依赖。它们将替换为基于您的Webpack输出配置的自动生成的URL。

非前缀URL，例如assets/logo.png将被视为与相对URL相同并被翻译成./assets/logo.png。

以前缀的网址~被视为模块请求，类似于require('some-module/image.png')。如果要利用Webpack的模块解析配置，则需要使用此前缀。例如，如果您有一个解决别名assets，您需要使用以确保别名受到尊重。

根相对URL，例如/assets/logo.png根本不处理。


在JavaScript中获取文件路径
为了使Webpack返回正确的文件路径，您需要使用require('./relative/path/to/file.jpg')，它将由处理file-loader并返回解析的URL。例如：
computed: {
  background () {
    return require('./bgs/' + this.id + '.jpg')
  }
}

注意上面的例子将包括./bgs/最终构建中的每个图像。这是因为Webpack无法猜测其中的哪些将在运行时使用，因此它包括所有。
“真正的”静态文件
相比之下，Webpack static/根本不处理文件：它们直接复制到其最终目的地，具有相同的文件名。您必须使用绝对路径引用这些文件，这是由join build.assetsPublicPath和build.assetsSubDirectoryin决定的config.js。
// config.js
module.exports = {
  // ...
  build: {
    assetsPublicPath: '/',
    assetsSubDirectory: 'static'
  }
}

static/应使用绝对URL引用放置的任何文件/static/[filename]。如果您更改assetSubDirectory为assets，则这些网址需要更改为/assets/[filename]。
我们将在有关后端集成的部分中了解有关配置文件的更多信息。

api-proxy.html.body:
开发过程中的API代理
当将此样板与现有后端集成时，常见的需求是在使用开发服务器时访问后端API。为了实现这一点，我们可以并行（或远程）运行dev服务器和API后端，并让dev服务器代理所有API请求到实际的后端。
要配置代理规则，请dev.proxyTable在中编辑选项config/index.js。dev服务器使用http-proxy-middleware 代理，所以你应该参考它的文档的详细用法。但这里有一个简单的例子
// config/index.js
module.exports = {
  // ...
  dev: {
    proxyTable: {
      // proxy all requests starting with /api to jsonplaceholder
      '/api': {
        target: 'http://jsonplaceholder.typicode.com',
        changeOrigin: true,
        pathRewrite: {
          '^/api': ''
        }
      }
    }
  }
}

上述例子将请求代理/api/posts/1到http://jsonplaceholder.typicode.com/posts/1。
网址匹配
除了静态网址，您还可以使用glob模式来匹配网址，例如/api/**。有关详细信息，请参阅上下文匹配。此外，您可以提供一个filter选项，可以是一个自定义函数来确定请求是否应该被代理：
proxyTable: {
  '*': {
    target: 'http://jsonplaceholder.typicode.com',
    filter: function (pathname, req) {
      return pathname.match('^/api') && req.method === 'GET'
    }
  }
}

seo.html.body:
预渲染SEO
如果您想要预渲染路由，一旦推送到生产，它不会显着更改，请使用此Webpack插件：prerender-spa-plugin，已经过测试与Vue一起使用。对于网页不经常更改，Prerender.io 和Netlify 都提供计划定期重新预呈现您的搜索引擎的内容。
Using prerender-spa-plugin

将其作为开发人员依赖关系安装：

npm install --save-dev prerender-spa-plugin


在build / webpack.prod.conf.js中需要它：
// This line should go at the top of the file where other 'imports' live in
var PrerenderSpaPlugin = require('prerender-spa-plugin')


在plugins数组中（也在build / webpack.prod.conf.js中）配置它：
new PrerenderSpaPlugin(
// Path to compiled app
path.join(__dirname, '../dist'),
// List of endpoints you wish to prerender
[ '/' ]
)



如果你也想预呈现/about和/contact，然后该数组会[ '/', '/about', '/contact' ]。
